// WindInfo.tsx (Create this new component to display wind information)
import { Box, Text } from '@chakra-ui/react';
import React from 'react';

interface Props {
  windData: {
    latitude: number;
    longitude: number;
    wind_speed: string;
    wind_direction: string;
    // Add other wind-related properties as needed
  };
}

const WindInfo: React.FC<Props> = ({ windData }) => {
  return (
    <Box mt={4}>
      <Text>
        Location: {windData.latitude}, {windData.longitude}
      </Text>
      <Text>
        Wind Speed: {windData.wind_speed}
      </Text>
      <Text>
        Wind Direction: {windData.wind_direction}
      </Text>
      {/* Add other wind-related properties as needed */}
    </Box>
  );
};

export default WindInfo;
